import styled from 'styled-components';

const Header = styled.h1`
  font-size: 1.0em;
  color: white;
  background-color: black;
`;

const Welcome = ()=>(
  <Header class='container'>
    <header className='row pt-3'>
      <div className='col-6 d-flex justify-content-center'>
        Loja do bim
      </div>
      <div className='col-6 d-flex justify-content-center '>
        Login
      </div>
    </header>
  </Header>
)

export default Welcome;
